import React, {Component} from 'react'
import Mobiles from './components/phones';
import './App.css'

class App extends Component {
  render(){
    return (
      <Mobiles mobiles={this.state.mobiles}/>
    )
  }
  state = {
    mobiles: []
  };
  componentDidMount(){
    const out = fetch('http://localhost:8080/phones')
    const data = out.json()
    .then((data) =>{
        this.setState({ mobiles: data})
    })
    .catch(console.log)
  }
}

export default App;
